 the simple past, use the following structure. Add <strong><span style=\\\"color:#c0392b\\\">'did not' </span></strong>or<span style=\\\"color:#c0392b\\\"><strong> 'didn't' </strong></span>after the subject, and then, follow it with the<strong> base form of the verb. </strong></p>\\n\\n<ul>\\n\\t<li>subject + did not/didn't + base form</li>\\n</ul>\\n\\n<p><span style=\\\"font-size:0.875em\\\">Examples:</span></p>\\n\\n<ul>\\n\\t<li><span style=\\\"font-size:0.875em\\\">The airplane <strong>did not arrive</strong> on time.</span></li>\\n\\t<li><span style=\\\"font-size:0.875em\\\">I <strong>didn't see</strong> my friend at school yesterday.</span></li>\\n</ul>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c7b73315-83aa-42be-a7c3-152fb5abebf1\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":70.0593336376084,\"y\":8.790218065025075,\"width\":2.577632696,\"height\":5.091753604,\"action\":{\"library\":\"H5P.Audio 1.5\",\"params\":{\"fitToWrapper\":true,\"playerMode\":\"minimalistic\",\"controls\":true,\"autoplay\":false,\"playAudio\":\"Play audio\",\"pauseAudio\":\"Pause audio\",\"contentName\":\"Audio\",\"audioNotSupported\":\"Your browser does not support this audio\",\"files\":[{\"path\":\"data:audio/mpeg;base64,//uUxAAAAAAAAAAAAAAAAAAAAAAAWGluZwAAAA8AAACzAADwqAADBQgKCw0PERQVGBwfIiMmKi0wMTM2OTo9P0NFRklLT1NVWFpdX2BjZ2lrbXF0eHp+goWHiIuOkJOUlpibnJ+ipKaoqq2wtLe6vsLEx8rN0NHU19vf4ubr7vDx8/T2+Pn7/f8AAABQTEFNRTMuMTAwBLkAAAAAAAAAABUgJALvgQAB4AAA8Kjuk9v/AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA//u0xAAABMQBMeAAACGQHaNw9 \"changes\":[],\"extraTitle\":\"Guess the right form!\"},\"subContentId\":\"93286219-5788-480e-bc53-8f807fdac94a\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Activity 3</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"7e667fb1-3422-46c8-b858-d18e94342988\"},\"useSeparator\":\"enabled\"},{\"content\":{\"library\":\"H5P.Blanks 1.14\",\"params\":{\"media\":{\"disableImageZooming\":false,\"type\":{\"params\":{\"contentName\":\"Image\",\"alt\":\"The Rainbow Fish and The Blue Fish having a conversation\",\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"044a7313-317a-4ba4-9345-1e188d909491\"}},\"text\":\"<p><strong>A few days later, Rainbow Fish and the blue fish met again. A friendly conversation took place between the two. </strong></p>\\n\\n<p><strong>Complete this conversation by using the correct form of the simple past tense for the verbs in parentheses. Use the affirmative, negative, or interrogative forms as needed.</strong></p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":100}],\"showSolutions\":\"Show solution\",\"tryAgain\":\"Retry\",\"checkAnswer\":\"Check\",\"notFilledOut\":\"Please fill in all blanks to view solution\",\"answerIsCorrect\":\"&#039;:ans&#039; is correct\",\"answerIsWrong\":\"&#039;:ans&#039; is wrong\",\"answeredCorrectly\":\"Answered correctly\",\"answeredIncorrectly\":\"Answered incorrectly\",\"solutionLabel\":\"Correct answer:\",\"inputLabel\":\"Blank input @num of @total\",\"inputHasTipLabel\":\"Tip available\",\"tipLabel\":\"Tip\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"autoCheck\":false,\"caseSensitive\":true,\"showSolutionsRequiresInput\":true,\"separateLines\":false,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"acceptSpellingErrors\":false},\"scoreBarLabel\":\"You got :num out of :total points\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"a11yCheckingModeHeader\":\"Checking mode\",\"confirmCheck\":{\"header\":\"Finish ?\",\"body\":\"Are you sure you wish to finish ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Finish\"},\"confirmRetry\":{\"header\":\"Retry ?\",\"body\":\"Are you sure you wish to retry ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Confirm\"},\"questions\":[\"<p>&nbsp;</p>\\n\\n<p><strong>Blue Fish:</strong> Hello, Rainbow Fish.</p>\\n\\n<p><strong>Rainbow Fish: </strong>Hey, Blue Fish. I've been looking for you. I (want) *wanted* to apologize to you because I (be)&nbsp;*was* being rude when I (decide) *decided* not to share one of my glittering scales with you. I (be) *was* so selfish.</p>\\n\\n<p><strong>Blue Fish:</strong> Don't say that. I understand how you (feel) *felt*. You finally (give) *gave* me a beautiful one. I am really thankful for that!</p>\\n\\n<p><strong>Rainbow Fish:</strong> You don't have to thank me. You’re my friend now. In the past, I (spend) *spent* my days alone. I (talk, not) *didn’t talk* to anyone. I also (swim) *swam* and (play) *played* alone. I (be, not) *wasn’t* happy at all. However, today, I have so many friends. But I have a question, Blue Fish. Why were you following me that day?</p>\\n\\n<p><strong>Blue Fish:</strong> I (see) *saw* you passing by. You (look) *looked* so beautiful, so I (go) *went* after you.&nbsp;I (like) *liked* your colorful, shiny scales, and I (want) *wanted* to have one of them. Does it make you sad that you (give) *gave* away your scales?</p>\\n\\n<p><strong>Rainbow Fish:</strong> Not at all! I actually feel happier now.</p>\\n\\n<p><strong>Blue Fish:</strong>&nbsp;Now, I feel relieved!&nbsp;</p>\\n\"],\"submitAnswer\":\"Submit\"},\"metadata\":{\"title\":\"An Imaginative Conversation\",\"license\":\"U\",\"defaultLanguage\":\"en\",\"contentType\":\"Fill in the Blanks\",\"authors\":[],\"changes\":[],\"extraTitle\":\"An Imaginative Conversation\"},\"subContentId\":\"a03d1cc3-e4f8-4845-a44c-94a51a405c10\"},\"useSeparator\":\"disabled\"}]}","library":"H5P.Column 1.16","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"Focus on Grammar- Simple Past Tense (Part 2)","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.AdvancedText-1.1/text.js?version=1.1.14","/h5p/libraries/H5P.Audio-1.5/scripts/audio.js?version=1.5.9","/h5p/libraries/H5P.Shape-1.0/js/h5p-shape.js?version=1.0.5","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progressbar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-ui.js?version=1.3.19","/h5p/libraries/H5P.CoursePresentation-1.25/dist/h5p-course-presentation.js?version=1.25.9","/h5p/libraries/H5P.Question-1.
